import React from 'react';
const Piece = (props) => {
  return (
      <div className="col-sm-4">
          <div className = "images">
            <img src={props.piece.thumbnail.url} className="card-img-top" />
          </div>
            <div className="card-body">
              <p className="card-title">{props.piece.name}</p>
              <p className="card-title">$ {props.piece.caption}</p>
            </div>
      </div>
  );
}
export default Piece;
